import React from 'react';

export default function BookType() {
  return (
    <div>
        <label for="BookTypeFilter">Book Type:</label>
        <select id="BookTypeFilter" name="book-type">
            <option value="one">one</option>
            <option value="two">two</option>
        </select>
    </div>
  )
}
